<script type="text/javascript">
	function Abrir_modal_EditT(url){
		$('#editar').load(url, function(){
			$(this).modal('show');
		});
	}
	
	document.addEventListener('DOMContentLoaded', function(){
 	 var paths = document.getElementsByClassName("lotes"); 
 	for (let path of paths) {
    	var color = path.getAttribute("data-estado");
    	if(color == "reservado"){
      		path.style.fill="#45C8ED"; 
    	}else if(color == "vendido"){
      		path.style.fill="#07D123"; 
    	}else if(color == "disponible"){
      		path.style.fill="white"; 
    }
  }
});

var pathsl = document.getElementsByClassName("lotes");
for (var i = 0; i < pathsl.length; i++) {
    pathsl[i].addEventListener("mouseover", function(){
        this.style.fill = "#ff9d0a";
    });
    pathsl[i].addEventListener("mouseout", function(){
		var paths = document.getElementsByClassName("lotes"); 
 		for (let path of paths) {
    		var color = path.getAttribute("data-estado"); 
    		if(color == "reservado"){
      			path.style.fill="#45C8ED"; 
    		}else if(color == "vendido"){
      			path.style.fill="#07D123"; 
   			}else if(color == "disponible"){
      			path.style.fill="white"; 
    		}
		}
    });
}

</script>
